contract GTokenV2 is IERC20, IERC20Metadata, Ownable {
    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;

    string private _name;
    string private _symbol;

    mapping(address => bool) private _fromBlackList; 
    mapping(address => bool) private _fromWhiteList; 
    mapping(address => bool) private _toBlackList; 
    mapping(address => bool) private _toWhiteList; 
    mapping(address => bool) private _whiteFeeList; 

    address private _router;
    address private _usdt;
    address private _feeAddr1;
    address private _feeAddr2;

    uint256 private _feeRate1 = 10;
    uint256 private _feeRate2 = 20;
    uint256 public constant PRECISION = 1000;

    mapping(address => bool) private _automatedMarketMakerPairs;

    
    mapping(address => uint256) private _lockValue;
    mapping(address => bool) private _isUnlockAddr;

    function _initLimitStrategy(address pair, address owner) private {
        _fromBlackList[pair] = true;
        _toBlackList[pair] = true;
        _fromWhiteList[owner] = true;
        _toWhiteList[owner] = true;
    }

    constructor(
        string memory name_,
        string memory symbol_,
        uint256 amount_,
        address router_,
        address usdt_,
        address feeAddr1_,
        address feeAddr2_
    ) {
        _name = name_;
        _symbol = symbol_;
        _router = router_;
        _usdt = usdt_;
        _feeAddr1 = feeAddr1_;
        _feeAddr2 = feeAddr2_;

        address pair = IUniswapFactory(IUniswapRouter02(_router).factory())
            .createPair(address(this), _usdt);
        setAutomatedMarketMakerPairs(pair, true);

        
        _initLimitStrategy(pair, owner());

        _mint(_msgSender(), amount_ * (10**uint256(decimals())));
    }

    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function decimals() public view virtual override returns (uint8) {
        return 18;
    }

    function balanceOf(address account)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _balances[account];
    }

    function transfer(address to, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        address owner = _msgSender();
        _transfer(owner, to, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        address owner = _msgSender();
        _approve(owner, spender, amount);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public virtual override returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        address owner = _msgSender();
        _approve(owner, spender, _allowances[owner][spender] + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        address owner = _msgSender();
        uint256 currentAllowance = _allowances[owner][spender];
        require(
            currentAllowance >= subtractedValue,
            "ERC20: decreased allowance below zero"
        );
        unchecked {
            _approve(owner, spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) private {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(
                currentAllowance >= amount,
                "ERC20: insufficient allowance"
            );
            unchecked {
                _approve(owner, spender, currentAllowance - amount);
            }
        }
    }

    function _mint(address account, uint256 amount) private {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);
    }

    function _tokenTransfer(
        address from,
        address to,
        uint256 amount
    ) private {
        uint256 fromBalance = _balances[from];
        require(
            fromBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );
        unchecked {
            _balances[from] = fromBalance - amount;
        }
        _balances[to] += amount;

        emit Transfer(from, to, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        require(
            !_fromBlackList[from] || _toWhiteList[to],
            "ERC20: transfer refuse by from"
        );
        require(
            !_toBlackList[to] || _fromWhiteList[from],
            "ERC20: transfer refuse by to"
        );

        bool isSwap = automatedMarketMakerPairs(from) ||
            automatedMarketMakerPairs(to);
        if (isSwap) {
            bool takeFee = !_whiteFeeList[from] && !_whiteFeeList[to];
            if (takeFee) {
                uint256 fee1 = (amount * _feeRate1) / PRECISION;
                _tokenTransfer(from, _feeAddr1, fee1);
                uint256 fee2 = (amount * _feeRate2) / PRECISION;
                _tokenTransfer(from, _feeAddr2, fee2);
                amount = amount - fee1 - fee2;
            }
        }
        _tokenTransfer(from, to, amount);
    }

    function addBlackOrWhiteList(
        bool isFrom,
        bool isBlack,
        address account,
        bool status
    ) public onlyOwner {
        if (isFrom) {
            if (isBlack) {
                _fromBlackList[account] = status;
            } else {
                _fromWhiteList[account] = status;
            }
        } else {
            if (isBlack) {
                _toBlackList[account] = status;
            } else {
                _toWhiteList[account] = status;
            }
        }
    }

    function accountStatus(address account)
        public
        view
        returns (
            bool inFromBlackList,
            bool inFromWhiteList,
            bool inToBlackList,
            bool inToWhiteList,
            bool inFeeWhiteList
        )
    {
        inFromBlackList = _fromBlackList[account];
        inFromWhiteList = _fromWhiteList[account];
        inToBlackList = _toBlackList[account];
        inToWhiteList = _toWhiteList[account];
        inFeeWhiteList = _whiteFeeList[account];
    }

    function addFeeWhiteList(address who, bool status) public onlyOwner {
        _whiteFeeList[who] = status;
    }

    function addMultipleFeeWhiteList(address[] calldata accounts, bool status)
        public
        onlyOwner
    {
        for (uint256 i = 0; i < accounts.length; i++) {
            _whiteFeeList[accounts[i]] = status;
        }
    }

    function addMultiBlackOrWhiteList(
        bool isFrom,
        bool isBlack,
        address[] memory accounts,
        bool status
    ) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            addBlackOrWhiteList(isFrom, isBlack, accounts[i], status);
        }
    }

    function defaultPair() public view returns (address) {
        return
            IUniswapFactory(IUniswapRouter02(_router).factory()).getPair(
                address(this),
                _usdt
            );
    }

    function automatedMarketMakerPairs(address account)
        public
        view
        returns (bool)
    {
        return _automatedMarketMakerPairs[account];
    }

    function setAutomatedMarketMakerPairs(address pair, bool status)
        public
        onlyOwner
    {
        _automatedMarketMakerPairs[pair] = status;
    }

    function addrs()
        public
        view
        returns (
            address router,
            address usdt,
            address feeAddr1,
            address feeAddr2
        )
    {
        router = _router;
        usdt = _usdt;
        feeAddr1 = _feeAddr1;
        feeAddr2 = _feeAddr2;
    }

    function values() public view returns (uint256 feeRate1, uint256 feeRate2) {
        feeRate1 = _feeRate1;
        feeRate2 = _feeRate2;
    }

    function setAddr(uint256 t, address addr) public onlyOwner {
        if (t == 0) {
            _router = addr;
        } else if (t == 1) {
            _usdt = addr;
        } else if (t == 2) {
            _feeAddr1 = addr;
        } else if (t == 3) {
            _feeAddr2 = addr;
        }
    }

    function setParamValue(uint256 t, uint256 value) public onlyOwner {
        if (t == 0) {
            _feeRate1 = value;
        } else if (t == 1) {
            _feeRate2 = value;
        }
    }
}
